commits.content:
#login {
    display: flex;
    justify-content: center;
    height: 100vh;
    align-items: center;
}




.login-section {
    /* display: flex; */
    /* justify-content: center; */
    /* height: 100%; */
    /* align-items: center; */
    padding: 40px 10px;
    margin: 10px;
    border: 2px solid darkgrey;
    border-radius: 10px;
}

.login-details {
    margin: 20px;
    font-size: xx-large;
    display: flex;
    align-items: center;
    justify-content: flex-end;
}

.input {
    font-size: x-large;
    border: none;
    border: 1px solid #8a0080;
    border-bottom: 3px solid #8a0080;
    border-bottom-left-radius: 10px;
    border-top-right-radius: 10px;
    /* border-radius: 0px; */
    /* border: 1px solid gray; */
    background: #efeeee59;
}

#submit {
    font-size: xxx-large;
    background: purple;
    border: none;
    border-bottom: 5px solid #4b034b;
    border-radius: 5px;
}
